import logo from './logo.svg';
import './App.css';
import { useState } from 'react';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css'
function App() {
  const [value, setValue] = useState('');


  const handleEvaluate = () => {
    try {
      const evaluatedResult = eval(value);
      set
    } catch (error) {
      toast.error('Invalid expression entered', {
        position: toast.POSITION.TOP_RIGHT
      });
      setValue('');
    }
  };

  const handleClear = () => {
    setValue('');
  };


  return (
    <div className='container'>
      <div className='calculator'>
        <form action=''>
          <div className='screen'>
            <input type='text' value={value} readOnly />
          </div>
          <div>
            <input type='button' value='AC' onClick={handleClear} />
            <input type='button' value='C' onClick={() => setValue(value.slice(0, -1))} />
            <input type='button' value='.' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='/' onClick={(e) => setValue(value + e.target.value)} />
          </div>
          <div>
            <input type='button' value='7' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='8' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='9' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='*' onClick={(e) => setValue(value + e.target.value)} />
          </div>
          <div>
            <input type='button' value='4' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='5' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='6' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='+' onClick={(e) => setValue(value + e.target.value)} />
          </div>
          <div>
            <input type='button' value='1' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='2' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='3' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='-' onClick={(e) => setValue(value + e.target.value)} />
          </div>
          <div>
            <input type='button' value='00' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='0' onClick={(e) => setValue(value + e.target.value)} />
            <input type='button' value='=' className='equal' onClick={handleEvaluate} />
          </div>
        </form>

      </div>
    </div>
  );
}

export default App;
